import React from "react";

const TicketCard = ({ ticket }) => {
  const getPriorityIcon = (priority) => {
    const icons = {
      High: "/icons_FEtask/Img - High Priority.svg",
      Medium: "/icons_FEtask/Img - Medium Priority.svg",
      Low: "/icons_FEtask/Img-LowPriority.svg",
      Urgent: "/icons_FEtask/SVG-UrgentPrioritycaution.svg",
      default: "/icons_FEtask/No-priority.svg",
    };
    return icons[priority] || icons.default;
  };

  return (
    <div className="ticket-card">
      <h3>{ticket.id}</h3>
      <p>{ticket.title}</p>
      <img
        src={getPriorityIcon(ticket.priority)}
        alt={`${ticket.priority || "No Priority"} icon`}
        className="priority-icon"
      />
      <p className="tag">{ticket.tag}</p>
    </div>
  );
};

export default TicketCard;
